	add("admiral", "{\"term\":\"admiral\", \"etymology\":{\"influencers\":[], \"languages\":[\"Arabic\", \"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027amirail\u0027 \u0027amiral\u0027 (modern \u0027amiral\u0027 , from Arabic \u0027أَمِير البَحْر\u0027 (commander of the fleet) Later associated with \u0027admirable\u0027 Akin to \u0027amir\u0027 \u0027amir\u0027 and \u0027emir\u0027 First recorded in English September, 1300, to refer to Gerard Allard of {{w|Winchelsea}}, referred to as “Admiral of the Fleet of the {{w|Cinque Ports}}”.\u0026lt;ref\u0026gt;The Mastery of the Sea, by Cyril Field, [http://books.google.com/books?id\u003drCWEeUgtXp0C\u0026amp;pg\u003dPA234\u0026amp;dq\u003d%22Gervase+Allard%22+admiral page 234]\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A naval officer of the highest rank; the commander of a country\u0027s naval forces\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A naval officer of high rank, immediately below Admiral of the Fleet; the commander of a fleet or squadron\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A flag officer in the United States Navy or United States Coast Coast Guard of a grade superior to vice admiral and junior to admiral of the fleet (when that grade is used). An admiral is equal in grade or rank to a four star general\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The ship which carries the admiral, the flagship; also, the most considerable ship of a fleet\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A prince or Saracen leader under the Sultan\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Any of various nymphalid butterflies of Europe and America, especially a red admiral or white admiral\", \"priority\":6}]}, \"synonyms\":{}}");

